import './navbar.css';

const NavBar = () => {
    return (
        <>
            <div className="navbar">
                <div className="navLeft">
                    <i class="fas fa-mobile"></i>
                </div>
                <div className="navCenter"></div>
                <div className="navRight"></div>
            </div>
        </>
    );
}

export default NavBar;
